import React from 'react';
import './brand.css';

// Import Home02 components only
import Header from './components/layouts/home02/Header';
import Home02 from './components/pages/Home02';
import Footer from './components/layouts/home02/Footer';

function App() {
  return (
    <div className="App" id="top">
      <Header />
      <Home02 />
      <Footer />
    </div>
  );
}

export default App;
